import axios from 'axios'
import React, {useEffect, useState} from 'react'
import { useParams } from 'react-router-dom'

import ProfilePage from '../Css/ProfilePage.css'

function PersonalPage() {

  const [utente,setUtente] = useState("");

  let {id} = useParams();

  useEffect(() => {

    axios.get(`http://localhost:3002/auth/ottieniUtenti/${id}`).then((response)=>{

      console.log(utente);
      setUtente(response.data.username); //li memorizza dentro lo stato

    });

  }, [])



  return (
    <div className='ContainerProfilePage'>
      <div className="itemsProfilePage">

            <h1>ciao</h1>
            <h1>{utente.username}</h1>
      </div>

    </div>
  )
}

export default PersonalPage
